import React from "react";

const FeedbackStats = ({ feedback }) => {
  return (
    <div className="feedback-stats">
      <h4>{FeedbackStats.length} Reviews</h4>
      <h4>Average Rating: 10</h4>
    </div>
  );
};

export default FeedbackStats;
